import styled from 'styled-components';
import logo from '../images/yugiohlogo.svg';

function Logo() {

    return (
        <StyledImage />
    )
}

const StyledImage = styled.image`
    height: 75px;
    width: 100px;
    min-height: 50px;
    min-width: 75px;
`;

StyledImage.defaultProps = {
    src: logo,
    alt: 'logo'
}

export default Logo;
